import React, { Component } from "react";

class Shore extends Component<any, any> {
  public componentDidMount() {
    console.log("componentDidMount");
  }

  public static getStaticProps = (context: any) => ({props: { name: "shore" }});

  render() {
    return <div>shore eee {this.props.name}</div>;
  }
}

export default Shore;
